import * as React from "react";
import {
  Link,
  AppBar,
  Box,
  Toolbar,
  IconButton,
  Typography,
  Menu,
  Grid,
  Avatar,
  Button,
  Tooltip,
  MenuItem,
} from "@mui/material";
import MenuIcon from "@mui/icons-material/Menu";

const Navbar = () => {
  return (
    <AppBar position="static" sx={{ backgroundColor: "secondary.main" }}>
      <Grid
        container
        position="relative"
        sx={{
          display: "contents",
          flexDirection: "row",
          width: "100%",
          justifyContent: "space-between",
        }}
      >
        {/* Abstract Background Image
        <Box sx={{ position: "absolute", right: 0 }}>
          <img
            src="/images/menu-stripes.png"
            alt="Abstract graphic with dots and lines."
            height="120px"
            width="auto"
          />
        </Box> */}

        <Toolbar disableGutters sx={{ p: 2 }}>
          {/* PAGE NAME. Left Side. */}
          <Grid item>
            <Link
              variant="h1"
              noWrap
              underline="none"
              color="#ffffff"
              href="/"
              sx={{
                mr: 2,
                display: { xs: "flex", sm: "flex", md: "flex", lg: "flex" },
              }}
            >
              Neat Name Generator
            </Link>
          </Grid>

          {/* Right Side. */}
          <Grid container sx={{ justifyContent: "end" }}></Grid>

          {/* MOBILE MENU*/}
          {/* Hamburger menu displays when screen is XS or S */}
          {/* <Box>
            <Tooltip title="Open pages">
              <MenuIcon
                onClick={handleOpenHamburgerMenu}
                sx={{
                  anchorEl: "right",
                  mr: 1,
                  display: {
                    xs: "flex",
                    sm: "flex",
                    md: "none",
                    lg: "none",
                  },
                }}
              />
            </Tooltip>
          </Box> */}
        </Toolbar>
      </Grid>
    </AppBar>
  );
};
export default Navbar;
